import React from "react";

export default function postData(data) {
  fetch("http://localhost:3001/users", {
    method: "POST",
    headers: {
      Accept: "application/json",
      "Content-Type": "application/json",
    },
    body: JSON.stringify(data),
  }).then((res) => res.json());
  return <div></div>;
}
